import React from "react";
import LoginDialog from "./LoginDialog";
import Register from "./Register";
class LogOrRegister extends React.Component {
	render() {
		return (
			<div className="Info">
				<p>
					Want more? <LoginDialog /> or <Register />
				</p>
			</div>
		);
	}
}
export default LogOrRegister;
